import React, {Component} from 'react'
class Message extends Component{
    constructor(){
        super()
        this.state = {
            message:'dont try understand your partner show ample amount love on her'
        }
    }
    changeMessage(){
        this.setState({
            message: 'thanks for good quote'
        })
    }
    render(){
        return(
            <div>
            <h1>{this.state.message}</h1>
            <button onclick = {()=> this.changeMessage()}>subscribe</button>
            </div>
        )
    }
}
export default  Message
